import React from 'react';
import '../index.css';
import {Jumbotron, Button} from 'reactstrap';

function Footer() {
    return (
        <div id="footer">
            <Jumbotron className="justify-content-around d-flex flex-row">
                <div>
                    <h2>Contatti</h2>
                    <p>Althea di Caruso Adelfio</p>
                    <p>Via Bologna 94/a</p>
                    <p>Partinico, PA</p>
                </div>

                <div>
                    <h2>Seguici su</h2>
                    <hr></hr>
                    <div className="row">
                        <a href="https://www.facebook.com/" target="_blank"><i class="fab fa-facebook fa-2x" id="facebook"></i></a>
                        <a><i class="fab fa-instagram fa-2x ml-2"></i></a>
                    </div>
                </div>
            </Jumbotron>
        </div>
    );
}

export default Footer;
